import imagen from "../imganes/yo.jpeg"
import s from "../components/About.module.css"


export default function About(){
    return(
        <div>
            <h1>App Rick and Morty</h1>
            <h2>Creada por Carla Formento</h2>
            <img calssName={s.imagen} src={imagen}/>
            <p>Esta es mi primera aplicaci√≥n creada en React en el curso de Henry de FullStack</p>
        </div>
    )
}
